import React from 'react';
// import logo from './logo.svg';
import './App.css';
// import TodoList from './components/TodoList'
// import { Provider } from 'react-redux'
import store from './store/store'

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <TodoList/>
      </Provider>
    </div>
  );
}

export default App;
